description:
This is bleach season 9 the best quality that I current found, I might release the rest of the current dub season in 720p later.

 The original uploader (themanuel08) put the videos in English and Japanese without sub-titles and he was missing episode 181 so to save space I take Japanese audio and add episode 181 in 720p myself.

Information
-Episode 168-189
-1280x720p
-English Dub
-100mb per episode expect for 181 which is 200mb


